import React from 'react'
import Postpage from './Postpage'

function Postcreation({post}) {
  const display=()=>{
    console.log("clicked");
    return (<Postpage post={post}></Postpage>)
  }

  return (
    <div key={post.id} className='' onClick={display}>
        <div className='border-bottom border-bottom-2 ps-4 d-flex flex-column mt-1 row-gap-0'>
            <h2 className='mb-1'>{post.title}</h2>
            <p className='mb-1'>{post.timeAndDate}</p>
            <p className='mb-1'>
                {post.body.length >=25?
                    post.body.slice(0,25)+" . . ."
                    :post.body}
            </p>
        </div>
    </div>
  )
}

export default Postcreation
